        <input type= "text" name = "city"/> 
        <br/>
        <br/>
        <label> State: </label>
        <br/>
        <input type= "text" name = "state"/> 
        <br/>
        <br/>
        <label> Zip Code: </label>
        <br/>
        <input type= "text" name = "zip"/> 
        <br/>
        <br/>
        <input type= "submit" value="Submit" />
        </form>
        <br/>
        <br/>
        {/* <button onClick={handleCreateAccount}> Create Account</button> */}


        </div>




        </div>
      );
    };

